// components/Admin/ServiceRequestTable.jsx
import React, { useEffect, useState } from 'react';
import styles from './ServiceRequestTable.module.css';

const dummyRequests = [
  { id: 1, user: 'Siva', type: 'Electricity', status: 'Pending' },
  { id: 2, user: 'Rahul', type: 'Cleaning', status: 'Completed' },
  { id: 3, user: 'Ravi', type: 'Water', status: 'In Progress' }
];

const ServiceRequestTable = () => {
  const [requests, setRequests] = useState([]);

  useEffect(() => {
    setRequests(dummyRequests);
  }, []);

  return (
    <div className={styles.container}>
      <h2>All Service Requests</h2>
      <table>
        <thead>
          <tr>
            <th>User</th>
            <th>Service</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {requests.map(req => (
            <tr key={req.id}>
              <td>{req.user}</td>
              <td>{req.type}</td>
              <td>{req.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ServiceRequestTable;
